import React, { Fragment, useEffect, useState } from "react";
import {
  Typography,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import { useSelector, useDispatch } from "react-redux";
import axios from "axios";

const SandboxPage = () => {
  const user = useSelector((state) => state.authSlice);
  const dispatch = useDispatch();
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchAllUsers = async () => {
      try {
        const { data } = await axios.get("users");
        setUsers(data);
        console.log(data);
      } catch (e) {
        console.log(e);
      }
    };
    fetchAllUsers();
  }, []);

  if (!user) {
    return <p>Loading...</p>;
  }

  const updateUserProfile = (userId, updatedData) => {
    dispatch({ type: "UPDATE_USER_PROFILE", userId, updatedData });
  };

  const viewCRMSystem = () => {
    window.location.href = "/crm";
  };

  const changeUserStatus = async (userId, isBusiness) => {
    try {
      const data = { status: isBusiness };

      // Send the PATCH request with the data
      await axios.patch(
        `https://monkfish-app-z9uza.ondigitalocean.app/bcard2/users/${userId}`,
        data
      );

      // Assuming you have a state variable `users` and a function `setUsers` to update it
      const updatedUsers = users.filter((user) => user._id !== userId);
      setUsers(updatedUsers);
    } catch (error) {
      console.log("Error updating user status:", error);
    }
  };

  const blockUser = (userId) => {
    dispatch({ type: "BLOCK_USER", userId });
  };

  const deleteUser = async (userId) => {
    try {
      await axios.delete(`users/${userId}`);
      const updatedUsers = users.filter((user) => user._id !== userId);
      setUsers(updatedUsers);
    } catch (error) {
      console.log("Error deleting user:", error);
    }
  };

  const handleStatusChange = (userId, newStatus) => {
    console.log(`Changed status for user ID ${userId} to ${newStatus}`);
  };

  const handleBlockUser = (userId) => {
    blockUser(userId);
    console.log(`Blocked user with ID: ${userId}`);
  };

  return (
    <Fragment>
      <Typography variant="h1">Sandbox</Typography>

      {user.isAuthenticated && (
        <div>
          <Button
            onClick={() =>
              updateUserProfile(user.id, {
                /* updated user data */
              })
            }
          >
            Update Profile
          </Button>
        </div>
      )}

      {user.isAdmin && (
        <div>
          <Button onClick={viewCRMSystem}>View CRM System</Button>
        </div>
      )}

      {user.isAdmin && (
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>User ID</TableCell>
                <TableCell>User Name</TableCell>
                <TableCell>User Phone</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {users.map((userData) => (
                <TableRow key={userData._id}>
                  <TableCell>{userData._id}</TableCell>
                  <TableCell>{userData.name.first}</TableCell>
                  <TableCell>{userData.phone}</TableCell>
                  <TableCell>
                    <Button onClick={() => deleteUser(userData._id)}>
                      Delete
                    </Button>
                    <Button
                      onClick={() =>
                        handleStatusChange(userData._id, "newStatus")
                      }
                    >
                      Edit Status
                    </Button>
                    <Button onClick={() => handleBlockUser(userData._id)}>
                      Block
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Fragment>
  );
};

export default SandboxPage;
